import { createRouter, createWebHistory } from 'vue-router';
import HomePage from '../views/home.vue';
import PageOne from '../views/PageOne.vue';
import PageTwo from '../views/PageTwo.vue';
import PageThree from '../views/PageThree.vue';
import PageFour from '../views/PageFour.vue';
import PageFive from '../views/PageFive.vue';

const routes = [
  {
    path: '/',
    name: 'Home',
    component: HomePage
  },
  {
    path: '/page1',
    name: 'Page1',
    component: PageOne // Update from 'Page1' to 'PageOne'
  },
  {
    path: '/page2',
    name: 'Page2',
    component: PageTwo // Update from 'Page2' to 'PageTwo'
  },
  {
    path: '/page3',
    name: 'Page3',
    component: PageThree // Update from 'Page3' to 'PageThree'
  },
  {
    path: '/page4',
    name: 'Page4',
    component: PageFour // Update from 'Page4' to 'PageFour'
  },
  {
    path: '/page5',
    name: 'Page5',
    component: PageFive // Update from 'Page5' to 'PageFive'
  }
];

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
});

export default router;
